DROP DATABASE IF EXISTS test_idesoft;
CREATE DATABASE test_idesoft; 
USE test_idesoft;

CREATE TABLE local(
fecha VARCHAR (50),
local_id INT,
local_nombre VARCHAR (70),
comuna_nombre VARCHAR (50),
localidad_nombre VARCHAR (50),
local_direccion VARCHAR (100),
funcionamiento_hora_apertura VARCHAR (20),
funcionamiento_hora_cierre VARCHAR (20),
local_telefono VARCHAR (20),
local_lat VARCHAR (50),
local_lng VARCHAR(70),
funcionamiento_dia VARCHAR (10),
fk_region INT,
fk_comuna INT,
CONSTRAINT pk_local_id PRIMARY KEY (local_id)
);

